import React from "react";
import "../styles/recommendations.css";

const Recommendations = () => {
  return (
    <div className="recommendations">
      <h1>Your Recommendations</h1>
      <p>Here are your personalized skincare product recommendations based on your profile.</p>
      <ul>
        <li>Product A - Best for Oily Skin</li>
        <li>Product B - Best for Dry Skin</li>
      </ul>
    </div>
  );
};

export default Recommendations;
